var mesh,image,imageBump;
var nImage=0;
var incli=-23.43*Math.PI/180;
var noAxe=false;
var isDiag=true;
var nbEnv=4;
var tEnv=[6380,6300,3500,1250];
var tColEnv=["#BB9922","#226622","#777777","#444444"];
var hasSat=true;
